%h1 {
  font-family: "Manrope", sans-serif;
  font-weight: 400;
}

%primary-text-style {
  color: $primary-text-color;
  font-family: $primary-font-family;
  font-style: normal;
}

%flex-center {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

%flex-column-start {
  display: flex;
  flex-direction: column;
  align-items: center;
}

%form-field-small {
  box-sizing: border-box;
  border-radius: $border-radius;
  background: $placeholder-bg-color;
  border: 2px solid transparent;
  width: 100%;
  font-size: 14px;
  line-height: $field-heigth;
}

%form-placeholder-small {
  color: $placeholder-text-color;
  background-color: $placeholder-bg-color;
  font-family: $primary-font-family;
  font-size: 14px;
  font-weight: 400;
  line-height: 140%;
  letter-spacing: 0.15px;
}

%link-style {
  text-decoration: none;
  cursor: pointer;
}

%link-no-highlight {
  outline: 0;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
}

%visually-hidden {
  clip: rect(0 0 0 0);
  clip-path: inset(50%);
  height: 1px;
  overflow: hidden;
  position: absolute;
  white-space: nowrap;
  width: 1px;
}

%navigation-icon-size {
  height: $icon-size-mobile;
  width: $icon-size-mobile;

  @include for-tablet() {
    height: $icon-size-tablet;
    width: $icon-size-tablet;
  }
}

%background-style {
  background-position: top center;
  background-size: cover;
  background-repeat: no-repeat;
}

