sources.styles\\blocks\\header.scss:
.header {
  min-height: 100vh;
  padding: 24px 20px 40px;
  box-sizing: border-box;
  background-image: url(../images/header-bg-mob.jpg);
  @extend %background-style;

  display: grid;
  justify-content: center;
  grid-template-columns: repeat(2, 130px);
  grid-template-rows: 1fr 1fr;
  gap: 20px;

  @include for-tablet() {
    background-image: url(../images/header-bg-tabl.png);
    grid-template-columns: repeat(6, 80px);
    gap: 24px;
    padding: 32px 72px 64px;
  }

  @include for-desktop() {
    background-image: url(../images/header-bg-desk.png);
    grid-template-columns: repeat(12, 63px);
    padding: 32px 120px 64px;
  }

  &__navigation {
    align-self: start;
    grid-column: 1 / 3;
    grid-row: 1 / 2;

    @include for-tablet() {
      grid-column: 1 / 7;
    }

    @include for-desktop() {
      grid-column: 1 / 13;
    }
  }

  &__title {
    align-self: end;
    grid-column: 1 / 3;
    grid-row: 2 / 3;

    @include for-tablet() {
      grid-column: 1 / 7;
    }

    @include for-desktop() {
      grid-column: 1 / 13;
    }
  }
}

