sources.styles\\blocks\\burger.scss:
.burger {
  @extend %navigation-icon-size;
  padding-left: 12px;

  @include for-tablet() {
    padding-left: $basic-offset;
  }

  &::before {
    content: "";
    background-image: url(../images/Icon-Burger-menu.svg);
    background-size: cover;
    display: inline-block;
    @extend %navigation-icon-size;
  }

  &::after {
    display: none;
    content: "";
    background-image: url(../images/Icon-Burger-menu-hover.svg);
    background-size: cover;
    @extend %navigation-icon-size;
  }

  &:hover {
    &::before {
      display: none;
    }
    &::after {
      display: inline-block;
    }

  }
  &__label {
    @extend %visually-hidden;
  }
}

